import React, { Fragment, useState } from "react";
import ReactPaginate from 'react-paginate';
import "./styles.css";

const PaginationEmployerListingHelper = ({  }) => {

    const [ currentPage, setCurrentPage ] = useState(0);

    const handlePageClick = () => {
        console.log("handlePageClick clicked/ran.");
    }
    return (
        <Fragment>
            <ReactPaginate
                previousLabel="previous"
                nextLabel="next"
                breakLabel="..."
                breakClassName="page-item"
                breakLinkClassName="page-link"
                pageCount={10}
                pageRangeDisplayed={6}
                marginPagesDisplayed={2}
                onPageChange={handlePageClick}
                containerClassName="pagination justify-content-center container-classname-pagination-custom"
                pageClassName="page-item"
                pageLinkClassName="page-link"
                previousClassName="page-item"
                previousLinkClassName="page-link"
                nextClassName="page-item"
                nextLinkClassName="page-link"
                activeClassName="active active-tabbed-pagination"
                // eslint-disable-next-line no-unused-vars
                hrefBuilder={(page, pageCount, selected) =>
                    page >= 1 && page <= pageCount ? `/page/${page}` : '#'
                }
                hrefAllControls
                forcePage={currentPage}
                onClick={(clickEvent) => {
                    console.log('onClick', clickEvent);
                    // Return false to prevent standard page change,
                    // return false; // --> Will do nothing.
                    // return a number to choose the next page,
                    // return 4; --> Will go to page 5 (index 4)
                    // return nothing (undefined) to let standard behavior take place.
                }}
            />
        </Fragment>
    );
}
export default PaginationEmployerListingHelper;
